	<script>
		function CreateBotSearchCommandString() {
			var BotSearchCommand = "custom:" + ShipTypeIndexes[ShipTypes.indexOf(document.getElementById("shiptype").value)]
			var ShipPartIndexesList = ShipPartIndexes[ShipTypes.indexOf(document.getElementById("shiptype").value)]
			var ShipParts = GetSelectedParts()
			
			var FullMatch
			var PartlyPatch
			for(var i = 0; i < ShipParts.length; i++) {
				for(var j = 0; j < ShipPartIndexesList.length; j++) {
					if (ShipPartIndexesList[j].toUpperCase().includes(ShipParts[i].toUpperCase())) {
						//BotSearchCommand = BotSearchCommand + "," + (j+1).toString()
						PartlyPatch = j + 1
					}
					if (ShipPartIndexesList[j].toUpperCase() == ShipParts[i].toUpperCase()) {
						//BotSearchCommand = BotSearchCommand + "," + (j+1).toString()
						FullMatch = j + 1
					}
				}
				if (FullMatch) {
					BotSearchCommand = BotSearchCommand + "," + (FullMatch).toString()
				} else if (PartlyPatch) {
					BotSearchCommand = BotSearchCommand + "," + (PartlyPatch).toString()
				}
				FullMatch = null
				PartlyPatch = null
			}
			for (var i = 0; i < SelectedColors.length; i++) {
				var ColorGroup = ""
				for (var j = 0; j < SelectedColors[i].length; j++) {
					ColorGroup = ColorGroup + "C" + SelectedColors[i][j]
				}
				if (ColorGroup.length > 0) {
					BotSearchCommand = BotSearchCommand + "," + ColorGroup
				}
			}
			document.getElementById("CommandBox").value  = BotSearchCommand
		}
		
		document.getElementById("buttonCreate").addEventListener("click", CreateBotSearchCommandString);
		
		function GetSelectedParts() {
			var children = document.getElementById('PartLists').getElementsByTagName('*');
			var selected_ship_parts = [];
			for(var i = 0; i < children.length; i++) {
				if (children[i].options) {
					var item = children[i].options[children[i].selectedIndex]
					if (item) {
						selected_ship_parts.push(item.value)
						//console.log(selection);
					}
				}
			}
			return selected_ship_parts
		}

		function ColorButtonTriggered(event) {
			//let buttonColor = window.getComputedStyle(this).backgroundColor;
			var targetElement = event.target || event.srcElement;
			var PaletteIndex = parseInt(targetElement.outerText)
			
			if (targetElement.parentNode.style.boxShadow) {
				targetElement.parentNode.style.boxShadow = ""
				SelectedColors[0].splice(SelectedColors[0].indexOf(PaletteIndex), 1); 
			} else {
				targetElement.parentNode.style.boxShadow = "0px 0px 0px 3px black"
				SelectedColors[0].push(PaletteIndex)
			}
			

			var hsl = rgb2hsl(COLORS[PaletteIndex-1][0],COLORS[PaletteIndex-1][1],COLORS[PaletteIndex-1][2])
			var hue = " hue-rotate(" + Math.floor(hsl[0]-180).toString() + "deg)" //
			var sat = " saturate(" + (hsl[1]+0.29).toString() + ")"
			var light = " brightness(" + hsl[2] + ")"
			//console.log(light)
						
			var childDivs = document.getElementById('FighterPartImages').getElementsByTagName('img');
			for( i=0; i < childDivs.length; i++ ) {
				childDivs[i].style.filter  = hue + sat
			}
		}

			document.getElementById("buttonColor" + i.toString()).addEventListener("click", ColorButtonTriggered);

		function rgb2hsl(r,g,b) {
			let v=Math.max(r,g,b), c=v-Math.min(r,g,b), f=(1-Math.abs(v+v-c-1)); 
			let h= c && ((v==r) ? (g-b)/c : ((v==g) ? 2+(b-r)/c : 4+(r-g)/c)); 
			return [60*(h<0?h+6:h), f ? c/f : 0, (v+v-c)/2];
		}
		
		function DisplayShip(PARTS) {
			var wing = ""
			var subwing = ""

			for (let i = 0; i < PARTS.length; i++) { 
				if (PARTS[i].includes("_WING")) {
					wing = PARTS[i]
				}
			}	
			for (let i = 0; i < PARTS.length; i++) { 
				if (PARTS[i].includes("_SUBWING")) {
					subwing = PARTS[i]
				}
			}
			if (subwing == "_SUBWINGS_A" && wing == "_WINGS_K") {
				subwing = "_SUBWINGS_B1"
			} else if (subwing == "_SUBWINGS_E" && wing == "_WINGS_K") {
				subwing = "_SUBWINGS_A1"
			}	
			
			var LAYERS = []
			for (let i = 0; i < PARTS.length; i++) { 
				if (PARTS[i].includes("_SUBWING")) {
					LAYERS.push(wing + subwing + "_LEFT")
					LAYERS.push(wing + subwing + "_RIGHT")
				} else {
					LAYERS.push(PARTS[i] + "_LEFT")	
					LAYERS.push(PARTS[i] + "_RIGHT")	
				}
			}
			

			var childDivs = document.getElementById('FighterPartImages').getElementsByTagName('img');

				} else {

				}
			}
		}

			}
		}
		
		function PartOptionsSelectionChanged(event) {
			var targetElement = event.target || event.srcElement;
			
			for (let i = 0; i < CurrentPartOptions.length; i++) { 
				if (CurrentPartOptions[i][0] == targetElement.name)  {
					CurrentPartOptions[i][1] = targetElement.selectedIndex
				}
			}
			RefreshDisplay()
		}
		
		function CleanDropDownLists() {
			var filter = ["DECAL","LOGO","SIGN","LETTER","RECTANGLE","SIDEL"]
			for (let i = 0; i < CurrentPartOptions.length; i++) { 
				for (let k = 0; k < CurrentPartOptions[i][2].length; k++) { 
					for( var j = 0; j < filter.length; j++) {
						if (CurrentPartOptions[i][2][k].toUpperCase().includes(filter[j]))  {
							//console.log("X")
							//document.getElementById(CurrentPartOptions[i][0]).innerHTML = ""
							if (document.getElementById(CurrentPartOptions[i][0])) {
								document.getElementById(CurrentPartOptions[i][0]).remove()
							}
						}
					}
				}
			}
		}
		
		function PartOptionsDifferentialProcessing() {
			document.getElementById("PartLists").innerHTML = "";
			
			if (CurrentPartOptions.length > 0) {
				for (let i = 0; i < CurrentPartOptions.length; i++) { 
					for (let j = 0; j < NewPartOptions.length; j++) { 
						if (CurrentPartOptions[i][0] == NewPartOptions[j][0]) {
							NewPartOptions[j][1] = CurrentPartOptions[i][1]
						}
					}
				}
			}

			for (let i = 0; i < NewPartOptions.length; i++) { 
				var select = document.getElementById(NewPartOptions[i][0]);
				if (!select) {
					select = document.createElement("select");
					select.name = NewPartOptions[i][0];
					select.id = NewPartOptions[i][0];
				}
				
				for (let j = 0; j < NewPartOptions[i][2].length; j++) { 
					var option = document.createElement("option");
					var partName = NewPartOptions[i][2][j]
					option.value = partName
					displayText = partName.replace("_","").replaceAll("_"," ")
					//displayText = displayText.charAt(0) + displayText.slice(1).toLowerCase();
					option.text = displayText
					select.appendChild(option);
					
					select.addEventListener("change", PartOptionsSelectionChanged);
				}
				
				select.selectedIndex = NewPartOptions[i][1]
				
				document.getElementById("PartLists").appendChild(select);
			}
			
			CurrentPartOptions = NewPartOptions
		}
		
		function GenerateDropdownPartLists(TABLE) {
			var RESULT_LIST = []
			NewPartOptions = []
			GenerateParts(RESULT_LIST,TABLE)
			PartOptionsDifferentialProcessing()
			return RESULT_LIST
		}
	
		function RefreshDisplay() {
			GenerateDropdownPartLists(ShipParts[ShipTypes.indexOf(document.getElementById("shiptype").value)])
			CleanDropDownLists()
			DisplayShip(GetSelectedParts())
		}
		
		RefreshDisplay()
		 
	</script>
	


	</body>
</html>
